import React, { ReactElement } from 'react';
import './App.css';
import Cell from "./Components/Cell/Cell"
import { Stage, Layer }  from 'react-konva';

function row(y:number): ReactElement {
  const n = []
  for(let i = 1; i < 20; i++)
    n.push(i*55)

  const res = n.map(x => 
      <Cell 
        x={x}
        y={y}
      />
    )

  return <div>{res}</div>

}

function grid(): ReactElement {
  const num = []
  for(let i = 1; i < 20; i++)
    num.push(i*55)

  const res = num.map(y => 
    row(y)
  )

  return <div>{res}</div>
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Stage width={window.innerWidth} height={window.innerHeight}>
      <Layer>
          {grid()}
      </Layer>
      </Stage>
      </header>
    </div>
  );
}

export default App;
